import { LogoContainer, NavbarContainer, LinksContainer, ListItem, DateContainer } from './styles'
import HomeRoundedIcon from '@mui/icons-material/HomeRounded';
import { NavLink } from 'react-router-dom';

const Navbar = () => {
    return(
      <NavbarContainer>
        <LogoContainer>Traceable</LogoContainer>

        <LinksContainer>
          <ListItem>
            <NavLink to='/campaings'>
              <HomeRoundedIcon style={{ fill: '#ffffff' }}/>
              Campanhas
            </NavLink>
          </ListItem>
        </LinksContainer>        
      </NavbarContainer>
    )
}

export default Navbar
